let InitialState = {
    status: 'STATUS',
}


const ProfileReducer = (state = InitialState, action) =>
{
    switch (action.type)
    {
        case UP_STATUS_TEXT:
        {
          let copyState= {...state};
          copyState.status = action.newTextMessage;
          return copyState;
        }
        default:
            return state;
    }
return state;
}

export default ProfileReducer;
